import styled from 'styled-components';

const StyledFooter = styled('footer')`
width:100%;
display:grid;
place-items:center;
background:white;`

const Footer = () => {
    return <StyledFooter>Copyright 2020. Designed and Developed by Irene K.</StyledFooter>
}

export default Footer;
